import React from 'react';
import logo from '../../../assets/logo.png';

const NavBar = () => {
  return (
    <div className="navbar">
      <div className="searchbar">
        <div className="search-input" placeholder="Put your spot here !">
          iji
        </div>
        <div className="current-location">iji</div>
        <div className="webcam-link">Accéder à la webcam</div>
      </div>
      <div className="logo">
        <img src={logo} alt="logo" />
      </div>
      <div className="login"></div>
    </div>
  );
};

export default NavBar;
